import React, { useEffect, useState } from "react";

const OwnersTable = () => {
  const [owners, setOwners] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState("");

  const [searchInput, setSearchInput] = useState(""); // Typing input
  const [searchQuery, setSearchQuery] = useState(""); // Applied search

  useEffect(() => {
    fetch("http://localhost:5000/owners_list", { credentials: "include" })
      .then((res) => res.json())
      .then((data) => {
        if (data.success) setOwners(data.owners);
        else setError(data.message || "Failed to fetch owners");
        setLoading(false);
      })
      .catch((err) => {
        console.error(err);
        setError("Error fetching owners");
        setLoading(false);
      });
  }, []);

  const filteredOwners = owners.filter((owner) =>
    `${owner.first_name} ${owner.last_name} ${owner.email} ${owner.mobile_number} ${owner.nationality}`
      .toLowerCase()
      .includes(searchQuery.toLowerCase())
  );

  if (loading) return <p>Loading owners...</p>;
  if (error) return <p>{error}</p>;

  const currentDate = new Date().toLocaleDateString();

  return (
    <div style={{ padding: "20px" }}>
      {/* ✅ Header Section */}
      <div style={{ display: "flex", justifyContent: "space-between", marginBottom: "15px" }}>
        <div>
          <span>{currentDate}</span> | <span>Total Owners: {filteredOwners.length}</span>
        </div>
        <h2>List of Owners</h2>
        <a href="/index" style={{ textDecoration: "none" }}>← Go Back Home</a>
      </div>

      {/* ✅ Search Section */}
      <div style={{ marginBottom: "10px" }}>
        <input
          type="text"
          placeholder="Search owner..."
          value={searchInput}
          onChange={(e) => setSearchInput(e.target.value)}
          style={{ padding: "8px", width: "300px" }}
        />
        <button
          onClick={() => setSearchQuery(searchInput)}
          style={{ padding: "8px 12px", marginLeft: "5px" }}
        >
          Search
        </button>
        <button
          onClick={() => {
            setSearchInput("");
            setSearchQuery("");
          }}
          style={{ padding: "8px 12px", marginLeft: "5px", background: "lightgray" }}
        >
          Clear
        </button>
      </div>

      {/* ✅ Owners Table */}
      <div style={{ overflowX: "auto" }}>
        <table border="1" cellPadding="8" style={{ borderCollapse: "collapse", minWidth: "100%" }}>
          <thead>
            <tr>
              <th>Owner Code</th>
              <th>First Name</th>
              <th>Last Name</th>
              <th>Email</th>
              <th>Mobile</th>
              <th>Nationality</th>
              <th>EID Image</th>
              <th>Passport Copy</th>
              <th>Visa</th>
            </tr>
          </thead>
          <tbody>
            {filteredOwners.map((owner) => (
              <tr key={owner.owner_code}>
                <td>{`OW${owner.owner_code.toString().padStart(5, "0")}`}</td>
                <td>{owner.first_name}</td>
                <td>{owner.last_name}</td>
                <td>{owner.email}</td>
                <td>{owner.mobile_number}</td>
                <td>{owner.nationality}</td>
                <td>{owner.eid_image && <img src={`data:image/*;base64,${owner.eid_image}`} width={50} alt="EID" />}</td>
                <td>{owner.passport_copy && <img src={`data:image/*;base64,${owner.passport_copy}`} width={50} alt="Passport" />}</td>
                <td>{owner.res_visa && <img src={`data:image/*;base64,${owner.res_visa}`} width={50} alt="Visa" />}</td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    </div>
  );
};

export default OwnersTable;
